import React from "react";

const Ngopage = () => {
  return (
    <div>
      <h1>
        for ngos
        <br /> THIS PAGE IS UNDER CONSTRUCTION
        <br /> PLEASE COME HERE AFTER SOME DAYS
        <br /> aree jao na dikh nhi rha ki page abhi nhi bna phir bhi dekhe ja rhe ho <br />
        bola na thore din bad aana ab jao
      </h1>
    </div>
  );
};

export default Ngopage;
